INSERT INTO `rs_tbl_news` VALUES (1,'Dr. Uma\'s visit to Shymkent, Kazakhstan','On 22.01.2020, the visit of Dr. Uma to Kazakhstan, to the office of the IDIP-2 project in the city of Shymkent.&nbsp;\r\n<div>On this occasion, a dinner was organized for all project employees for acquaintance and exchange, both cultural and professional.&nbsp;</div>\r\n<div>On 23.01.2020, a presentation was held on the implementation of the project, and goals for business development were discussed both in Kazakhstan and in neighboring countries, such as Tajikistan and Uzbekistan.&nbsp;</div>\r\n<div>The speakers were Senior Resident Engineers:</div>\r\n<div>1.<span style=\"white-space:pre\">	</span>Tigran Kalantaryan</div>\r\n<div>2.<span style=\"white-space:pre\">	</span>Grzegorz Rokicki</div>\r\n<div>3.<span style=\"white-space:pre\">	</span>Zohrab Gevorgyan</div>\r\n<div>And also, Business Development Manager - Natalya Levitskaya.&nbsp;</div>\r\n<div>&nbsp;</div>','2020-01-22',1,'7c4f2-1.jpg','4f2d6-1.jpg','2d644-1.jpg','','','Y'),(2,'Trainings under Component 3 with Rice Growing Institute','From November 18, 2019 to November 21, 2019, trainings were conducted on Component 3, where the following were discussed:\r\n<div><b>MODULE No.1: </b>Technology for the reclamation of alkaline soil in the fields;</div>\r\n<div><b>MODULE No.2: </b>Optimal seeding structures. Crop rotation. High-quality farming technology, taking into account the land of the SPAs;</div>\r\n<div><b>MODULE No.3: </b>Modern technologies for the production of corn.</div>\r\n<div>&nbsp;</div>\r\n<div>During the trainings, presentation materials on technologies for improving the reclamation state of degraded, saline and alkaline lands using phosphogypsum, bioshungite and biocampost were demonstrated, new rice crop rotation schemes with the introduction of diversification crops, and corn and silage production technology were recommended.</div>\r\n<div>&nbsp;</div>\r\n<div>The leading scientists of the Kazakh Research Institute of Rice named after I. Zhakhaev acted as lecturers:</div>\r\n<div>1. Duysembekov Bakhytzhan Alisherovich, Candidate of Biological Sciences, Corresponding Member of the Academy of Agricultural Sciences, Acting Director General of the Institute;</div>\r\n<div>2. Khasi Zhamantikov, Doctor of agricultural sciences, Chief Researcher at the department of agricultural technology, land reclamation and soil science;</div>\r\n<div>3. Shermagambetov Kamaldin, Leading Researcher in the department of agricultural technology, land reclamation and soil science;</div>\r\n<div>4. Begaliev Kanagat Bilyalovich, Candidate of agricultural sciences, leading researcher in the department of potato and melon growing.</div>\r\n<div>&nbsp;</div>\r\n<div>Multimedia installations were used to demonstrate presentation materials.</div>\r\n<div>Additional employees of the Kazakh Research Institute of Rice named after I. Zhakhaev were involved as assistants for the organization of seminars, coffee breaks and dinners. Also, coffee breaks were organized for listeners.</div>\r\n<div>&nbsp;</div>','2019-11-18',1,'baf76-2.jpg','','','','','Y'),(4,'Trainings under Component 3 with Water Economy Institute in Zhalagash','November 6, 2019 - November 7, 2019, trainings were held on Component 3, where the following were discussed:\r\n<div>MODULE No.1: Water resources management and their measurement;</div>\r\n<div>MODULE No.2: Ecological safe operation of irrigation systems in land reclamation.</div>\r\n<div>In addition, video clips on the use of drip irrigation and sprinkling technologies, the application of ecological technologies to improve the reclamation state of degraded and saline lands using phosphogypsum, the use of water measuring instruments on irrigation canals, and others were demonstrated.</div>\r\n<div>&nbsp;</div>\r\n<div>The leading researchers of the Kazakh Scientific Research Institute of Water Economy acted as lecturers:</div>\r\n<div>1. Mirdadayev Mirobit Salimovich, Candidate of technical sciences, Deputy General Director for scientific work and implementation of KazSRIWE;</div>\r\n<div>2. Abduramanov Nurlan Abdumanapovich, Candidate of technical sciences, Senior Researcher of the department of Technology and irrigation technology KazSRIWE;</div>\r\n<div>3. Tattibaev Khasan Aitbekovich, Candidate of technical sciences, Senior Researcher of the department of Technology and irrigation technology of KazSRIWE;</div>\r\n<div>4. Dzhaysambekova Raushan Amanbekovna, Candidate of technical sciences, Head of the sector &ldquo;Land Reclamation and Ecology of Irrigated Territories&rdquo; of KazSRIWE;</div>\r\n<div>5. Basmanov Alexander Viktorovich, Master of Agricultural Sciences, Researcher, Department of M&amp;E KazSRIWE.</div>\r\n<div>Additional assistants of KazSRIWE were involved as assistants in organizing seminars, coffee breaks and dinners, coffee breaks were organized for students, and vehicles were also arranged from the seminar venue to the coffee break venue.</div>\r\n<div>&nbsp;</div>','2019-11-06',1,'5a7e0-4.jpg','27218-4.jpg','4953b-4.jpg','','','Y'),(6,'Financial training in Shymkent office','During the month of February 2020, financial training for CAR region financial representatives was organized, for which Regional Reporting Manager from Pakistan with 20 years of experience &ndash; Amjad Rasheed was invited. Kazakhstan, Georgia and Tajikistan were participating in the training.\r\n<div>It was a great opportunity for all SMEC employees to get a new experience in financial sphere by studying the following topics:&nbsp;</div>\r\n<div>1.<span style=\"white-space:pre\">	</span>Time and Expense Entries</div>\r\n<div>2.<span style=\"white-space:pre\">	</span>Time and Expense Reports</div>\r\n<div>3.<span style=\"white-space:pre\">	</span>Time/Expense Reversal/Transfer</div>\r\n<div>4.<span style=\"white-space:pre\">	</span>Transaction Reports</div>\r\n<div>5.<span style=\"white-space:pre\">	</span>Preparation of Invoices&nbsp;</div>\r\n<div>6.<span style=\"white-space:pre\">	</span>Invoice Entry in SMECnet</div>\r\n<div>7.<span style=\"white-space:pre\">	</span>Billing Summary Report</div>\r\n<div>8.<span style=\"white-space:pre\">	</span>Debtors Report</div>\r\n<div>9.<span style=\"white-space:pre\">	</span>SMECnet Workbench</div>\r\n<div>10.<span style=\"white-space:pre\">	</span>SMEC Planner</div>\r\n<div>11.<span style=\"white-space:pre\">	</span>WIP</div>\r\n<div>12.<span style=\"white-space:pre\">	</span>Cash Sheet Templates</div>\r\n<div>13.<span style=\"white-space:pre\">	</span>Cash Sheet Portal</div>\r\n<div>14.<span style=\"white-space:pre\">	</span>Preparation of the Cash Sheets</div>\r\n<div>15.<span style=\"white-space:pre\">	</span>Reconciliations</div>\r\n<div>16.<span style=\"white-space:pre\">	</span>Uploading of the Cash sheets and Reconciliations.</div>\r\n<div>17.<span style=\"white-space:pre\">	</span>IFRS-16 (Nomos)</div>\r\n<div>18.<span style=\"white-space:pre\">	</span>Record Keeping, Supporting Documents, Filing of the Accounting Records</div>\r\n<div>19.<span style=\"white-space:pre\">	</span>VAT transactions in the cash sheets</div>\r\n<div>20.<span style=\"white-space:pre\">	</span>ECCL Salary Invoices processing</div>\r\n<div>21.<span style=\"white-space:pre\">	</span>Accounts Payable invoices processing</div>\r\n<div>22.<span style=\"white-space:pre\">	</span>IMTRs and relevant issues&nbsp;</div>\r\n<div>23.<span style=\"white-space:pre\">	</span>Discussion on PIT&nbsp;</div>\r\n<div>24.<span style=\"white-space:pre\">	</span>Discussion on VAT Returns</div>\r\n<div>25.<span style=\"white-space:pre\">	</span>Discussion on CIT</div>\r\n<div>26.<span style=\"white-space:pre\">	</span>Other Accounting issues to be raised by the Accountants</div>','2020-02-04',1,'6383a-6.jpg','f9a49-6.jpg','81638-6.jpg','d532d-6.jpg','','Y'),(7,'COVID-19 precocious measures taken by SMEC','<b>&nbsp;Measures by Local Mangament of SJ-SMEC:</b> <br />\r\n<ul>\r\n    <li>Hand Sanitizers, Anti-Bacterial hand wash &amp; face masks purchased and placed in all offices. On few locations we are finding difficulty to purchase these things because of shortage in market, however our teams are continuously searching.</li>\r\n    <li>Thermometers purchased and placed in all offices. Temperature register for all employees has been created for monitoring and sent for use on sites. Every Friday the readings of thermometers are received by HSE manager. The situation on sites are monitored on a daily basis.&nbsp; No one is allowed to enter Shymkent office and people, who enter the office, pass medical check. There is a health check questionnaire for outside people, where the temperature is measured and other symptoms are monitored by HSE manager with record on the health check questionnaire. Nur-Sultan office employees are working from home because of quarantine there from March 19, 2020.&nbsp;</li>\r\n    <li>All staff over 65 years age in Kazakhstan were asked to provide home input from&nbsp; March 16, 2020.</li>\r\n    <li>Health Advice Posters &amp; Guides for COVID-19 (Official posters from the Ministry of Healthcare of the Republic of Kazakhstan) have been posted&nbsp; in all offices.</li>\r\n    <li>Information for Kazakhstan:</li>\r\n    <li>Nur-Sultan and Almaty cites are under quarantine from the 19th of March 2020. No entry and no exit from the cities. People are not allowed to go outside unless necessary.&nbsp;</li>\r\n    <li>Karaganda and neighboring four towns Abay, Saran, Temirtau and Shahtinsk are under quarantine from the 30th of March 2020.&nbsp;&nbsp;</li>\r\n    <li>In order to prevent an increase in the number of COVID-19 cases, Akimat of Shymkent city restricted&nbsp; the entry and exit of all light vehicles to the city, exceptions are transit vehicles, which supply the city life activity and&nbsp; everyone, going outside should wear masks from 21.00 pm of the 31st of March 2020.&nbsp;&nbsp;</li>\r\n    <li>Carriage of passengers was restricted in North Kazakhstan oblast on March 30, 2020 and the quarantine in this region are strengthened from the 31st of March 2020. Entry to the Kostanai and Aktobe oblasts is blocked from the 31st of March 2020.&nbsp; Quarantine is effective at 19.00 pm on March 31, 2020 in Akmola oblast. Restrictions is effective in Zhambyl oblast at 00.00 on March 31 and at the same time an entry to Kyzylorda oblast are closed&nbsp;</li>\r\n    <li>Restrictions are introduced in Pavlodar oblast from the 1st of April.&nbsp; Restrictive measures are effective in Almaty and North Kazakhstan oblasts on April 1, 2020.&nbsp;</li>\r\n    <li>Petropavlovsk is closed from April 3, 2020 at 00.00 night. The number of affected people are 7.&nbsp;</li>\r\n    <li>Shymkent city is&nbsp; under quarantine from April 4, 2020 at 21.00&nbsp; local time. No entry, no exit from the city.</li>\r\n</ul>','2020-04-07',1,'c2202-7.jpg','','','','','Y'),(8,'      / Prime Minister of Kazakhstan gave instructions to akims and ministers','-                  . -   \"-\"                      .\r\n\r\nsource: TengriNews','2020-07-21',1,'d01e3-8.jpg','','','','','Y'),(9,'Covid-19 Global Statistics: More than 15 million infected','As of July 22, the total number of infected has reached 15,094,610.\r\n\r\nsource: TengriNews, Worldometers','2020-07-22',1,'29f92-9.jpg','5e4c2-9.png','','','','Y'),(10,'     / Health Minister addresses the public','\"    ,     ,      ,     .     ,    , .  .      .   ,       ,  ,  ,    ,   ,     \", -    - .\r\n\r\nsource: TengriNews','2020-07-21',1,'9b073-10.jpg','','','','','Y'),(11,'First Demonstration Training is successfully conducted under Component 2 in 2021','First Demonstration training under Component 2 was held in GMC SPA from 26.05-28.05.2021. \r\nKAZSRI of Water Economy conducted the training on a very professional level by showing how to use water measurement equipment. Water users were interested during the whole seminar and received the certificates on completion. \r\nKazVodHoz and PMU Representatives visited the training and wished a good luck to all participants.','2021-05-26',1,'b556d-11.jpg','','','','','Y');
